children.text:
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif; background: #f5f7fa; padding: 2rem 1rem; }

.container { max-width: 1200px; margin: 0 auto; }
h1 { text-align: center; color: #333; margin-bottom: 0.5rem; }
.subtitle { text-align: center; color: #666; margin-bottom: 2rem; }

/* Comparison Table */
.table-wrapper { background: white; border-radius: 8px; box-shadow: 0 2px 8px rgba(0,0,0,0.1); overflow: hidden; }

table { width: 100%; border-collapse: collapse; }

/* Header Row */
thead { background: #2c3e50; color: white; }
th { padding: 1.5rem; text-align: left; font-weight: 600; }
th:first-child { width: 30%; }

/* Body Rows */
tbody td { padding: 1.5rem; border-bottom: 1px solid #e0e0e0; }
tbody tr:last-child td { border-bottom: none; }

/* Alternating rows */
tbody tr:nth-child(even) { background: #f9f9f9; }
tbody tr:hover { background: #f0f4f8; }

/* Feature name column */
td:first-child { font-weight: 500; color: #2c3e50; }

/* Status cells */
.yes { color: #27ae60; font-weight: 600; }
.no { color: #e74c3c; font-weight: 600; }
.partial { color: #f39c12; font-weight: 600; }

/* Responsive */
@media (max-width: 768px) {
  table { font-size: 0.9rem; }
  th, td { padding: 1rem; }
}

.note { margin-top: 2rem; padding: 1rem; background: #fff3cd; border-left: 4px solid #ffc107; border-radius: 4px; }
.note strong { color: #856404; }
